import styled from "styled-components";

export const Container=styled.div`
margin: 20px 0px;
`


export const Content=styled.div`
width: 992px;
height: 60px;
background: #FFFFFF;
box-shadow: 0px 2px 2px rgba(174, 176, 181, 0.314986);
border-radius: 6px;
display: flex;
`
